export const EmptyDatabase = () => {
    return (
        <div className="col-md-16">
          <div className="card mb-1">
            <div className="card-body">
              <div className="empty-data">
                  <p> Sorry, there's no data to retrieve on the program database</p>
              </div>
            </div>
          </div>
      </div>
        );
}
